CREATE TABLE IF NOT EXISTS "DIMENSIONS"."OBJECT"
(
   OBJECT_KEY decimal(65535,32767) PRIMARY KEY NOT NULL,
   OBJECT_TYPE varchar(25) NOT NULL,
   OBJECT_ID_NAME varchar(25) NOT NULL,
   OBJECT_ID_VALUE varchar(25) NOT NULL
)
;
CREATE UNIQUE INDEX IF NOT EXISTS OBJECT_NK ON "DIMENSIONS"."OBJECT"
(
  OBJECT_TYPE,
  OBJECT_ID_NAME,
  OBJECT_ID_VALUE
)
;
CREATE UNIQUE INDEX IF NOT EXISTS PRIMARY_KEY_8A ON "DIMENSIONS"."OBJECT"(OBJECT_KEY)
;

